                        <html><head><meta charset="utf-8"></head><body>
<p>Витаминно-минеральный комплекс для собак малых размеров<br />Витаминно-минеральный комплекс содержит полностью усваиваемые формы витаминов и микроэлементов, разделенные на 2 приёма, удовлетворяет суточную потребность взрослой собаки, вне зависимости от вида питания.</p>
<p>В состав введены молекулы-транспортёры (альбумин), доставляющие витамины и минералы ко всем органам и тканям.</p>
<p>L-карнитин обеспечивает правильный метаболизм жиров, приток энергии, силу мышц, помогает здоровой работе сердца и печени.</p>
</body></html>

