                    <div class="tab-pane  "  id = "tab5">


                        <html><head><meta charset="utf-8"></head><body>
<p><strong>Назначение:</strong></p>
<div>витаминно-минеральный комплекс БИОРИТМ является функциональным (оздоровительным) кормом нового поколения. Содержит полностью усваиваемые формы витаминов и микроэлементов, разделенные на 2 приема, которые удовлетворяют суточную потребность взрослой собаки массой до 10 кг, вне зависимости от вида питания.</div>
<div>Так как собаки мелких пород часто бывают ограничены в прогулках, в состав введены молекулы-биотренажеры (альбумин), которые обогащают кислородом органы и ткани даже во время сна. L-карнитин обеспечивает правильный метаболизм жиров, приток энергии, силу мышц, помогает здоровой работе сердца и печени.</div>
<div>Формулы &laquo;Утро&raquo; и &laquo;Вечер&raquo; разработаны с учетом биологической потребности организма животного с дневной активностью, а также в соответствии с рекомендациями по раздельному и совместному приему полезных веществ. В результате организм получает необходимые вещества в полном объеме, а эффективность витаминной профилактики повышается на 30&ndash;50%.</div>
<div>Утренняя таблетка содержит компоненты, необходимые для усвоения энергии, улучшения пищеварения,&nbsp; укрепления нервной и иммунной системы, сердца и кровеносных сосудов, костей и зубов.</div>
<div>Вечерняя таблетка содержит компоненты для обогащения клеток кислородом, очищения почек, печени, крови, роста шерсти, правильного усвоения питательных компонентов, репарации тканей и органов.</div>
<div>&nbsp;</div>
<div><strong>Состав, энергетическая и пищевая ценность:</strong><br />минеральный комплекс; витаминный комплекс; дрожжи пивные, гидролизат коллагена, L-карнитин,вспомогательные компоненты.</div>
